import React, { useRef } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import BurritoList from './components/BurritoList';
import OrderForm from './components/OrderForm'; // Uncomment this line
import OrderDetails from './components/OrderDetails'; // Uncomment this line

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<BurritoList />} exact />
        <Route path="/create-order" element={<OrderForm />} /> {/* Uncomment this line */}
        <Route path="/order/:id" element={<OrderDetails />} /> {/* Uncomment this line */}
      </Routes>
    </Router>
  );
}

export default App;
